import React from 'react';
import { Navbar as CustomNavbar, Nav } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../NavBar/NavBar.css'

function NavBar() {
  return (
    <div>
      <CustomNavbar bg="light" expand="lg">
        <CustomNavbar.Brand href="/">GAN:ERATE</CustomNavbar.Brand>
        <CustomNavbar.Toggle aria-controls="basic-navbar-nav" />
        <CustomNavbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto navbar-links"> {/* navbar-links 클래스 추가 */}
            <Nav.Link href="/guide">이용안내</Nav.Link>
            <Nav.Link href="/data/generate">데이터 생성</Nav.Link>
            <Nav.Link href="/data/market">데이터 마켓</Nav.Link>
            <Nav.Link href="/data/search">데이터 검색</Nav.Link>
          </Nav>
          <Nav className="navbar-links"> {/* navbar-links 클래스 추가 */}
            <Nav.Link href="/auth/signin">로그인</Nav.Link>
            <Nav.Link href="/mypage">마이페이지</Nav.Link>
          </Nav>
        </CustomNavbar.Collapse>
      </CustomNavbar>
    </div>
  );
}

export default NavBar;
